import React, { Component } from 'react'
import { Paper, List } from '@mui/material'


export class MessageList extends Component {
    render() {
        const messages = this.props.events
        return (
            <Paper style={{overflow: 'auto'}}>
                <List>
                {messages}
                </List>
            </Paper>
        )
    }
}

export default MessageList
